import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    height: 86,
    width: 86,
    borderRadius: 40,
    borderWidth: 3,
    borderColor: "#ae22e0",
  },
  image: {
    height: 65,
    width: 65,
    margin: 10,
    borderRadius: 40,
    borderWidth: 1,
    borderColor: "#ffff",

  }
});

export default styles;
